import React, { useRef } from 'react';
import { motion, useInView } from 'framer-motion';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp } from '@fortawesome/free-brands-svg-icons';
import { faUsers, faHeadset, faHandshake, faComments } from '@fortawesome/free-solid-svg-icons';

const ContactSalesSection = () => {
  const sectionRef = useRef(null);
  const isInView = useInView(sectionRef, { once: true, amount: 0.3 });

  const handleWhatsAppContact = () => {
    // Replace with your actual WhatsApp number
    const phoneNumber = '+918123456789'; // Update this with your actual WhatsApp number
    const message = encodeURIComponent('Hi! I\'m interested in Myna Kitchen\'s meal plans and would like to discuss my requirements to choose the best plan for me.');
    const whatsappUrl = `https://wa.me/${phoneNumber}?text=${message}`;

    window.open(whatsappUrl, '_blank');
  };

  return (
    <section 
      ref={sectionRef}
      className="relative py-20 px-4 overflow-hidden"
      style={{
        background: 'linear-gradient(135deg, #A855F7 0%, #C084FC 50%, #E879F9 100%)'
      }}
    >
      {/* Background decorative elements */}
      <div className="absolute inset-0 opacity-10">
        <div className="absolute top-20 left-10 w-32 h-32 bg-white rounded-full blur-3xl"></div>
        <div className="absolute bottom-20 right-10 w-40 h-40 bg-white rounded-full blur-3xl"></div>
        <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-60 h-60 bg-white rounded-full blur-3xl"></div>
      </div>

      <div className="max-w-4xl mx-auto text-center relative z-10">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          animate={isInView ? { opacity: 1, y: 0 } : { opacity: 0, y: 30 }}
          transition={{ duration: 0.8, ease: "easeOut" }}
        >
          {/* Title with underline */}
          <div className="mb-8">
            <h2 className="text-4xl md:text-5xl lg:text-6xl font-bold text-gray-900 mb-2">
              Let's find your perfect plan
            </h2>
            <div className="w-24 h-1 bg-gray-900 mx-auto"></div>
          </div>

          {/* Description */}
          <motion.p 
            className="text-lg md:text-xl text-gray-800 mb-8 max-w-3xl mx-auto leading-relaxed"
            initial={{ opacity: 0, y: 20 }}
            animate={isInView ? { opacity: 1, y: 0 } : { opacity: 0, y: 20 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            Every person has unique dietary needs and preferences. That's why we recommend talking to our team once 
            to understand your requirements and help you choose the meal plan that's perfect for you.
          </motion.p>

          {/* Benefits grid */}
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={isInView ? { opacity: 1, y: 0 } : { opacity: 0, y: 20 }}
            transition={{ duration: 0.8, delay: 0.3 }}
            className="grid grid-cols-1 md:grid-cols-3 gap-6 mb-12"
          >
            <div className="bg-white/20 backdrop-blur-sm rounded-xl p-6 border border-white/30">
              <FontAwesomeIcon icon={faUsers} className="text-3xl text-gray-900 mb-3" />
              <h3 className="font-bold text-gray-900 mb-2">Personalized Recommendations</h3>
              <p className="text-gray-800 text-sm">Get meal plans tailored to your lifestyle and preferences</p>
            </div>
            <div className="bg-white/20 backdrop-blur-sm rounded-xl p-6 border border-white/30">
              <FontAwesomeIcon icon={faHeadset} className="text-3xl text-gray-900 mb-3" />
              <h3 className="font-bold text-gray-900 mb-2">Expert Guidance</h3>
              <p className="text-gray-800 text-sm">Our team will guide you through all available options</p>
            </div>
            <div className="bg-white/20 backdrop-blur-sm rounded-xl p-6 border border-white/30">
              <FontAwesomeIcon icon={faHandshake} className="text-3xl text-gray-900 mb-3" />
              <h3 className="font-bold text-gray-900 mb-2">Best Value Plans</h3>
              <p className="text-gray-800 text-sm">We'll help you find the most cost-effective solution</p>
            </div>
          </motion.div>

          {/* CTA Button */}
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            animate={isInView ? { opacity: 1, y: 0 } : { opacity: 0, y: 30 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="max-w-lg mx-auto"
          >
            <motion.button
              onClick={handleWhatsAppContact}
              className="w-full sm:w-auto px-12 py-5 bg-green-600 hover:bg-green-700 text-white rounded-full font-semibold text-xl transition-all duration-300 shadow-lg hover:shadow-xl transform hover:scale-105 flex items-center justify-center gap-3 mx-auto"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
            >
              <FontAwesomeIcon icon={faWhatsapp} className="text-2xl" />
              Contact Sales Team
            </motion.button>

            <p className="text-gray-700 text-sm mt-4 font-medium">
              Get instant responses on WhatsApp â€¢ Free consultation
            </p>
          </motion.div>

          {/* Trust indicators */}
          <motion.div
            initial={{ opacity: 0 }}
            animate={isInView ? { opacity: 1 } : { opacity: 0 }}
            transition={{ duration: 0.8, delay: 0.6 }}
            className="mt-8 flex flex-wrap justify-center items-center gap-6 text-sm text-gray-700"
          >
            <div className="flex items-center gap-2">
              <FontAwesomeIcon icon={faComments} className="text-green-600" />
              <span>Instant WhatsApp support</span>
            </div>
            <div className="flex items-center gap-2">
              <FontAwesomeIcon icon={faUsers} className="text-green-600" />
              <span>Personalized consultation</span>
            </div>
            <div className="flex items-center gap-2">
              <FontAwesomeIcon icon={faHandshake} className="text-green-600" />
              <span>No commitment required</span>
            </div>
          </motion.div>
        </motion.div>
      </div>
    </section>
  );
};

export default ContactSalesSection;
